extension ConnectIdenticonInteractor {
    
    struct IdenticonColor {
        let light: String
        let dark: String
        
        func hexColor(for scheme: ColorScheme) -> String {
            switch scheme {
            case .light:
                return light
            case .dark:
                return dark
            }
        }
